import React from 'react'
import Carousel from 'react-multi-carousel';
import {Container, Row, Col} from 'react-bootstrap'
import 'react-multi-carousel/lib/styles.css';
import './index.css'

const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    // 桌面上显示三个
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
};

export default function Skills() {
  return (
    <section>
        <Container className='skills-container'>
            <Row className='row-1'>
                <h2>Skills</h2>
                <p>写一小段</p>
            </Row>
            <Row>
                {/* Enables infinite scrolling in both directions. */}
                <Carousel responsive={responsive} infinite={true} className='skill-slider'>
                    <Col>
                    <div className='item'>
                        <img src="" alt="item-1" />
                        <h5>item-1</h5>
                    </div>
                    </Col>

                    <div className='item'>
                        <img src="" alt="item-2" />
                        <h5>item-2</h5>
                    </div>
                    <div className='item'>
                        <img src="" alt="item-3" />
                        <h5>item-3</h5>
                    </div>
                    <div className='item'>
                        <img src="" alt="item-4" />
                        <h5>item-4</h5>
                    </div>
                </Carousel>
            </Row>
        </Container>
    </section>
)
}
